import Logo from '../components/Logo';

const Index = () => (
  <div>
    <div className = "centered">
      <div className = "content">
        <div className = "header">
          <Logo />
        </div>
        <h2>michael c. martinez</h2>
        <p>i am a web developer currently building things with <a href="https://dialup.digital">DIAL UP Digital</a></p>
        <a href="https://github.com/harsimus">github</a>
      </div>
    </div>

    <style>
      {`
        html {
          position: relative;
          background-color: #000000;
        }

        body {
          margin: 0px !important;
          font-family: Helvetica, Arial, Sans-Serif;
          font-weight: bold;
          color: #FFFFFF;
        }

        a:link {
          color: #A44ABC;
          text-decoration: none;
          opacity: 0.8;
          transition: 0.3s;
        }

        a:hover {

          opacity: 1;
        }

        .centered {
          position: fixed;
          top: 50%;
          left: 50%;
          transform: translate(-50%, -50%);
        }

        .header {
          margin: 0 auto;
          text-align: center;
        }

        .content {
          text-align: justify;
          text-justify: inter-word;
        }
      `}
    </style>
  </div>
);

export default Index;
